package com.jlt.vote.bis.campaign.vo;import java.io.Serializable;/** * 用户首页信息 * @Author gaoyan * @Date: 2017/7/8 */public class SimpleUserVo implements Serializable {	/**	 * 编号	 */	private Integer number;	/**	 * 投票数量	 */	private Integer voteCount;	/**	 * 用户头像	 */	private String headPic;	/**	 * 用户名称	 */	private String name;	/**	 * 主键id     */	private Long userId;	public Integer getNumber() {		return number;	}	public void setNumber(Integer number) {		this.number = number;	}	public Integer getVoteCount() {		return voteCount;	}	public void setVoteCount(Integer voteCount) {		this.voteCount = voteCount;	}	public String getHeadPic() {		return headPic;	}	public void setHeadPic(String headPic) {		this.headPic = headPic;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}}